import React from 'react';
import './App.css';
import {Container} from "@chakra-ui/react";
import Navbar from "./components/Navbar";

function App() {
  return (
    <Container bg='#030303'>
      <header>
        <Navbar/>
      </header>
    </Container>
  );
}
export default App;
